import React  from 'react'
import CountDown from './CountDown'

class Index extends React.Component {
  render() {
    return (
      <div>
        <CountDown targetDate="Oct 25, 2021" targetTime="18:00:00" />
      </div>
    )
  }
}
export default Index;
